import React from "react";
import HomeNavBar from "../components/HomeNavBar";

function HomePage() {
  return (
    <div>
      <HomeNavBar />
      <div>
        <p className="md:italic">Discover Your Next Favorite Movie</p>
        <h2 className="text-5xl">The best way to find your next movie.</h2>
        <h4>
          Get personalized recommendations based on your preferences.
          Collaborate with a partner to choose the perfect film for any
          occasion. Explore movies tailored to your tastes and interests.
        </h4>
      </div>
    </div>
  );
}

export default HomePage;
